window.onload = init
function init() {
    var style = document.getElementsByTagName("style")[0]
    var head = document.getElementsByTagName("head")[0]
    document.body.innerHTML = document.body.innerHTML + html
    if (!style) {
        style = document.createElement("style")
        head.append(style)
    }
    style.innerHTML = styles
    document.getElementById("rahil-answers-2").style.display = "none"
    createButton()
    getCate()
    updates()
}
var toggle = true
function createButton() {
    var btn = document.createElement("button")
    btn.className = "rahil-bottom-button"
    btn.innerHTML = "<img src='data:image/png;base64,' style='width:75%;height:75%'>"
    document.body.append(btn)
    btn.onclick = () => {
        document.getElementById("rahil-form").reset()
        document.getElementById("rahil-success").hidden = true
        var el = document.getElementsByClassName("rahil-message")[0]
        if (toggle) {
            el.style.animation = "rahil-show 0.5s forwards"
            toggle = false
        }
        else {
            document.getElementsByClassName("rahil-message")[0].style.animation = "rahil-hide 0.5s forwards"
            toggle = true
        }
    }
}


function submitted(event) {
    var xml = new XMLHttpRequest()
    xml.responseType = "json"
    xml.open("POST", "https://support.serpwizz.com/api/create_ticket", true)
    var form = new FormData(event.target)
    xml.onload = () => {
        if (xml.response["status"] == "YES") {
            document.getElementById("rahil-success").hidden = false
            console.log(xml.response)
        }
    }
    xml.send(form)
}

function Ask() {
    document.getElementById("rahil-form").style.display = "block"
    document.getElementById("answers").style.display = "none"
    document.getElementById("updates").style.display = "none"
}
function Answer() {
    document.getElementById("rahil-form").style.display = "none"
    document.getElementById("answers").style.display = "block"
    document.getElementById("updates").style.display = "none"
}
function Updates() {
    document.getElementById("rahil-form").style.display = "none"
    document.getElementById("answers").style.display = "none"
    document.getElementById("updates").style.display = "block"
}

async function getData(url) {
    var xml = new XMLHttpRequest()
    xml.open("GET", url)
    xml.responseType = "json"
    var data = new Promise(resolve => {
        xml.onload = () => {
            resolve(xml.response)
        }
    })
    xml.send()
    return data
}

async function getCate() {
    try {
        var data = (await getData("https://support.serpwizz.com/api/all_category")).category
        var ul = document.getElementById("rahil-ul-1")
        for (var el of data) {
            let li = document.createElement("li")
            li.className = "rahil-li"
            li.onclick = getArt
            li.id = el.id
            li.innerHTML = el.name
            ul.append(li)
        }
    } catch (error) {
        getCate()
    }
}

async function getArt(event) {
    try {
        var id = event.target.id
        console.log(id)
        var data = (await getData("https://support.serpwizz.com/api/get_article_byid/" + id)).data
        document.getElementById("rahil-answers-2").style.display = "block"
        var ul = document.getElementById("rahil-ul-2")
        ul.innerHTML = ""
        if (typeof data == "string") return
        for (var el of data) {
            let li = document.createElement("li")
            li.className = "rahil-li"
            li.onclick = gotoNext
            li.id = el.article_url
            li.innerHTML = el.title+"?"
            ul.append(li)
        }
    } catch (error) {
        getArt(event)
    }
}

function gotoNext(event) {
    window.open(event.target.id, "_blank")
}

async function updates() {
    try {
        var data = (await getData("https://support.serpwizz.com/api/get-updates")).notification
        var len = data.length
        console.log(data)
        var updates_element = document.getElementById("updates")
        
        for (let index = 0; index < len; index++) {
            var details = document.createElement("div")
            var notif = data[index]
            details.className = 'rahil-details'
            details.innerHTML = `
            <div class='rahil-inner'></div>
            
            <div class='notif-date'>
            <span class="rahil-new"><b>NEW</b></span>
            <span class='rahil-created-at'>
               `+ notif.created_at + `  
             </span>
            </div>
          <div class='rahil-title'>`+ notif.title + `</div>
          <div class="rahil-hello">Hello Users</div>
          <div class='rahil-url' target='_blank'>
             <div class='rahil-summary'>
              `+ notif.summary + `
             </div>
             <a href=`+ notif.url + ` class='rahil-check-details'>Check Details</a>
          </div>
        `
        updates_element.append(details)
        }
    } catch (error) {
       updates()
    }
}

